import React from "react";
import moon from "../images/icon-moon.svg"
import sun from "../images/icon-sun.svg"
import "./Header.css";

function Header(props) {
  const onClick = () => {
    if (props.setChangeMode) { // Verifica si setChangeMode es una funci칩n v치lida
      props.setChangeMode(!props.changeMode);
    }
  };

  return (
    <header className={props.changeMode ? "headerDark" : "headerLight"}>
      <h1 className="title">DH Odonto</h1>
      <button className="button" onClick={onClick}>
        <img src={props.changeMode ? sun : moon} alt="Logo" style={"width = 100px"} />
      </button>
    </header>
  );
}

export default Header;
